#include <assert.h>

#include "bignum.h"


void expect(Number n, char *v)
{
	Number e = number(0);
	read(&e, v);
	assert(!cmp(n, e));
	clear(&e);
}

/* TODO: proper tests */
int main(void)
{
	Number a = number(0);
	Number b = number(0);
	Number c = number(0);
	/* sub */
	read(&a, "0x123456789abcdefedcba9876543210");
	read(&b, "0x912374198327491832749817348971298374981273498719283749817234987129384791234981237498123749875192357192381423");
	sub(&a, b);
	expect(a, "-0x912374198327491832749817348971298374981273498719283749817234987129384791234981114041999c8ca852b57ad91be3e213");
	/* mul */
	read(&a, "");
	read(&b, "");
	mul(&a, b);
	expect(a, "");
	/* quo */
	read(&a, "");
	read(&b, "");
	quo(&a, b);
	expect(a, "");
	/* quorem */
	read(&a, "0x123456789abcdefedcba9876543210");
	read(&b, "0x912374198327491832749817348971298374981273498719283749817234987129384791234981237498123749875192357192381423");
	quorem(&b, &c, a);
	expect(b, "0x7f90290a6c45874e365d9af9edddb5bcb813ce79ad83091dc1376ce2980ba0fb8859998c0e6e9c2");
	expect(c, "0x1231356f6a366934854b844a799403");
	read(&a, "");
	read(&b, "");
	quorem(&a, &c, b);
	expect(a, "");
	expect(c, "");
	/* square */
	read(&a, "");
	square(&a);
	expect(a, "");
	clear(&a);
	clear(&b);
	clear(&c);
	return 0;
}
